// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.7.0 <0.9.0;

// uint256 weight; // weight is accumulated by delegation
// bool voted; // if true, that person already voted
// address delegate; // person delegated to
// uint256 vote; // index of the voted proposal

contract ScooterRent {
    // struct Coords {
    //     string lat;
    //     string lon;
    // }
    uint256 public scooterCount = 1;

    struct Scooter {
        uint256 id;
        string name;
        string geoId;
        bool isRent;
        address rentBy;
        uint rentStartTime;
    }
    /// You can only rent a free scooter
    error OnlyNotRentedScooter();

    modifier isAvailableForRent(uint256 scooterId) {
        Scooter memory scooter = this.getScooter(scooterId);
        if (scooter.isRent == true) {
            revert OnlyNotRentedScooter();
        }
        _;
    }

    // event PayScooterRent(address user, uint256 id);
    Scooter[] public scooters;
    string private proccesedPays;

    mapping(address => Scooter[]) public userToScooters;


    function checkRentPossibility(uint256 scooterId)
        public
        view
        isAvailableForRent(scooterId)
        returns (bool)
    {
        return true;
    }

    function rentScooter(uint256 scooterId)
        public
        isAvailableForRent(scooterId)
    {
        uint256 scooterIdx = getScooterIdx(scooterId);
        scooters[scooterIdx].isRent = true;
        scooters[scooterIdx].rentBy = msg.sender;
        scooters[scooterIdx].rentStartTime = block.timestamp;

        userToScooters[msg.sender].push(scooters[scooterIdx]);
        // emit PayScooterRent(msg.sender, scooterId);
    }

    function getRentTime (uint256 scooterId) public view returns (uint256){
        uint256 scooterIdx = getScooterIdx(scooterId);
        return scooters[scooterIdx].rentStartTime;
    }

    function finishRent(uint256 scooterId) public {
        // Scooter[] memory  emptyScootersArr;
        uint256 scooterIdx = getScooterIdx(scooterId);
        scooters[scooterIdx].isRent = false;
        scooters[scooterIdx].rentBy = address(0);
        scooters[scooterIdx].rentStartTime = 0;


        uint deletedIdx = getScooterIdxFromArray(scooterId,userToScooters[msg.sender] );
        delete userToScooters[msg.sender][deletedIdx];

        // userToScooters[msg.sender][deletedIdx] =  userToScooters[msg.sender][deletedIdx - 1];
        // userToScooters[msg.sender].pop();
    }

    function addScooter(string memory name, string memory geoId) public {
        scooters.push(
            Scooter({
                id: scooterCount,
                name: name,
                geoId: geoId,
                isRent: false,
                rentBy: address(0),
                rentStartTime: 0
            })
        );
        scooterCount++;
    }

     function getScooterIdxFromArray(uint256 id, Scooter[] memory scootersArr ) public pure returns (uint256) {
        uint256 scooterIdx;
        bool isFindScooter = false;
        for (uint256 i = 0; i < scootersArr.length; i++) {
            if (scootersArr[i].id == id) {
                isFindScooter = true;
                scooterIdx = i;
                break;
            }
        }
        if (!isFindScooter) {
            revert("No Scooter");
        }
        return scooterIdx;
    }


    function getScooterIdx(uint256 id) public view returns (uint256) {
        uint256 scooterIdx;
        bool isFindScooter = false;
        for (uint256 i = 0; i < scooters.length; i++) {
            if (scooters[i].id == id) {
                isFindScooter = true;
                scooterIdx = i;
                break;
            }
        }
        if (!isFindScooter) {
            revert("No Scooter");
        }
        return scooterIdx;
    }

    function getUserScooters(address userId)
        public
        view
        returns (Scooter[] memory)
    {
        return userToScooters[userId];
    }

    function getScooter(uint256 id) public view returns (Scooter memory) {
        uint256 scooterIdx = getScooterIdx(id);
        return scooters[scooterIdx];
    }

    function getScooters() public view returns (Scooter[] memory) {
        return scooters;
    }

    function deleteScooter(uint256 id) public {
        uint256 scooterIdx = getScooterIdx(id);
        require(scooters[scooterIdx].isRent == false, "Scooter rented");
        scooters[scooterIdx] = scooters[scooters.length - 1];
        scooters.pop();
    }

    function editScooter(uint256 id, Scooter memory _newScooter) public {
        uint256 scooterIdx = getScooterIdx(id);
        scooters[scooterIdx] = _newScooter;
    }
}
